import React, { useState, useEffect } from 'react';
import * as signalR from '@microsoft/signalr';
import './App.css';

interface Item {
  id: string;
  name: string;
  price: number;
  updatedAt: string;
}

const App: React.FC = () => {
  const [items, setItems] = useState<Item[]>([]);
  const [connection, setConnection] = useState<signalR.HubConnection | null>(null);
  const [connectionStatus, setConnectionStatus] = useState<'Disconnected' | 'Connecting' | 'Connected' | 'Failed'>('Disconnected');
  const [isSubscribed, setIsSubscribed] = useState<boolean>(false);
  const [loading, setLoading] = useState<boolean>(true);

  // Load initial items
  useEffect(() => {
    const fetchInitialItems = async () => {
      try {
        const response = await fetch('https://localhost:7078/items');
        const data = await response.json();
        setItems(data);
        setLoading(false);
      } catch (err) {
        console.error('Failed to load initial items:', err);
        setLoading(false);
      }
    };

    fetchInitialItems();
  }, []);

  // Initialize and manage SignalR connection
  useEffect(() => {
    const newConnection = new signalR.HubConnectionBuilder()
      .withUrl("https://localhost:7078/pricehub", {
        skipNegotiation: false,
        transport: signalR.HttpTransportType.WebSockets,
        withCredentials: true
      })
      .build();

    setConnection(newConnection);

    // Connection event handlers
    newConnection.onclose(() => {
      setConnectionStatus('Disconnected');
      setIsSubscribed(false);
      console.log('Connection closed');
    });

    newConnection.onreconnecting(() => {
      setConnectionStatus('Connecting');
      console.log('Connection reconnecting...');
    });

    newConnection.onreconnected(() => {
      setConnectionStatus('Connected');
      console.log('Connection reestablished');
    });

    const startConnection = async () => {
      try {
        setConnectionStatus('Connecting');
        await newConnection.start();
        setConnectionStatus('Connected');
        console.log('SignalR Connected');
      } catch (err) {
        setConnectionStatus('Failed');
        console.error('Connection failed:', err);
      }
    };

    startConnection();

    return () => {
      newConnection.off('ReceivePriceUpdates');
      newConnection.off('ReceivePriceUpdate');
      newConnection.stop();
    };
  }, []);

  // Subscribe/unsubscribe logic
  const handleSubscription = async (subscribe: boolean) => {
    if (!connection) return;

    try {
      if (subscribe) {
        await connection.invoke('SubscribeToPriceUpdates');
        connection.on('ReceivePriceUpdates', (updatedItems: Item[]) => {
          setItems(updatedItems);
        });
        setIsSubscribed(true);
      } else {
        await connection.invoke('UnsubscribeFromPriceUpdates');
        connection.off('ReceivePriceUpdates');
        setIsSubscribed(false);
      }
    } catch (err) {
      console.error(subscribe ? 'Subscription failed' : 'Unsubscription failed', err);
    }
  };

  if (loading) {
    return <div className="loading">Loading initial items...</div>;
  }

  return (
    <div className="app">
      <h1>Price Updates</h1>

      <div className="connection-status">
        <span className={`status-indicator ${connectionStatus.toLowerCase()}`}></span>
        Status: {connectionStatus} {isSubscribed && '(Subscribed)'}
      </div>

      <div className="buttons">
        <button 
          className="subscribe-btn"
          onClick={() => handleSubscription(true)}
          disabled={connectionStatus !== 'Connected' || isSubscribed}
        >
          Subscribe
        </button>

        <button 
          className="unsubscribe-btn"
          onClick={() => handleSubscription(false)}
          disabled={connectionStatus !== 'Connected' || !isSubscribed}
        >
          Unsubscribe
        </button>
      </div>

      <div className="items-list">
        <table>
          <thead>
            <tr>
              <th>Name</th>
              <th>Price</th>
              <th>Updated At</th>
            </tr>
          </thead>
          <tbody>
            {items.map(item => (
              <tr key={item.id}>
                <td>{item.name}</td>
                <td>${item.price.toFixed(2)}</td>
                <td>{new Date(item.updatedAt).toLocaleTimeString()}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default App;
